import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
<script src="https://www.google.com/recaptcha/api.js" async defer></script>


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
